webpackJsonp([92696948310103],{4833:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Sunday",date:"20 Feb 2000",slug:"/2000-02-20-sunday/",tags:"Y2000"},html:'<p>"manilaExpressImage"<br />\nJeremy Bowers <a href="http://www.jerf.org/resources/manilaexpress.html">Manila Express(tm) for Netscape</a> <i>For the rest of us!</i></p>\n<p>This weekend, instead of adding content I\'ve been tweaking the layout.</p>'},next:{fields:{title:"Saturday",date:"19 Feb 2000",slug:"/2000-02-19-saturday/"}},previous:{fields:{title:"Monday",date:"21 Feb 2000",slug:"/2000-02-21-monday/"}}},{node:{fields:{title:"Saturday",date:"19 Feb 2000",slug:"/2000-02-19-saturday/",tags:"Y2000"},html:"<p>CNNSI: <a href=\"http://cnnsi.com/soccer/world/news/2000/02/18/german_roundup_ap/\">Berlin tops Hamburg</a> Berlin snaps Hamburg SV's seven-game unbeaten streak, but HSV will stay in 3rd place. 2nd place Leverkusen tied at Schalke. <i>I'm a fair weather HSV fan. If they were losing, as usual, I wouldn't be mentioning it.</i></p>"},next:{fields:{title:"Friday",date:"18 Feb 2000",slug:"/2000-02-18-friday/"}},previous:{fields:{title:"Sunday",date:"20 Feb 2000",slug:"/2000-02-20-sunday/"}}},{node:{fields:{title:"Friday",date:"18 Feb 2000",slug:"/2000-02-18-friday/",tags:"Y2000"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/02/crh0218.jpg" height="263" width="350" border="0" alt="crh0218.jpg: " /></p>\n<p><img src="http://shanson.editthispage.com/picture$156" align="right" />We were finally able to photograph a big smile from Christopher. Mama\'s trick was to take his current favorite toy (a garish Beanie Baby named "Spangle") and dangle it next to the camera.</p>\n<p><a href="http://albums.photopoint.com/j/AlbumIndex?u=185392&a=1898060">Week 8 Photos</a> at PhotoPoint </p>\n<p>An open and shut case of bednapping at <a href="http://familieberg.editthispage.com/2000/02/15">Familie Berg</a>: "Datt Bett is fott"! The text is in German, but the pictures are clear enough. <i>Good thing Moritz wasn\'t inside!</i></p>\n<p><a href="http://2020hindsight.editthispage.com/discuss/msgReader$253">2020 Hindsight</a>: "I want to take my PowerPC 8100 and throw it out the window". It turns out she <a href="http://2020hindsight.editthispage.com/2000/02/17">didn\'t</a>, it was only the CD-ROM that was flakey. An 8100 was my true friend and companion for nearly two years at <a href="http://www.int-res.com">Inter-Research</a>.</p>'},next:{fields:{title:'Scripting News: "Manila Express? is',date:"17 Feb 2000",slug:"/2000-02-17-scripting-news-manila-express-is/"}},previous:{fields:{title:"Saturday",date:"19 Feb 2000",slug:"/2000-02-19-saturday/"}}}],pathPrefix:"",first:!1,last:!1,index:1078,pageCount:1101}}}});
